function WorldMap({ sourceCountries, compact = false }) {
  // Only highlight the top 5 non-OTHER countries
  const top5 = sourceCountries
    .filter(c => c.code !== 'OTHER')
    .sort((a, b) => b.marketShare - a.marketShare)
    .slice(0, 5);

  const maxShare = top5.length > 0 ? top5[0].marketShare : 1;
  const top5Codes = new Set(top5.map(c => c.code));

  const getCountryColor = (code) => {
    const source = top5.find(c => c.code === code);
    if (!source) return 'var(--map-country-fill)';
    const normalized = source.marketShare / maxShare;
    const opacity = 0.15 + normalized * 0.55;
    return `rgba(200, 149, 108, ${opacity.toFixed(2)})`;
  };

  const getStrokeColor = (code) => {
    const source = top5.find(c => c.code === code);
    if (!source) return 'var(--map-country-stroke)';
    const normalized = source.marketShare / maxShare;
    const opacity = 0.3 + normalized * 0.5;
    return `rgba(139, 106, 78, ${opacity.toFixed(2)})`;
  };

  return (
    <div className={`world-map-container ${compact ? 'compact' : ''}`}>
      <svg viewBox="0 0 1020 500" className="world-map" preserveAspectRatio="xMidYMid meet">
        {/* Ocean background */}
        <rect x="0" y="0" width="1020" height="500" fill="var(--map-bg)" />

        {/* Grid lines */}
        <g opacity="0.04" stroke="var(--map-grid)" strokeWidth="0.5">
          {[...Array(10)].map((_, i) => (
            <line key={`lat${i}`} x1="0" y1={50 * i} x2="1020" y2={50 * i} />
          ))}
          {[...Array(13)].map((_, i) => (
            <line key={`lng${i}`} x1={85 * i} y1="0" x2={85 * i} y2="500" />
          ))}
        </g>

        {/* All countries */}
        <g>
          {Object.entries(countryPaths).map(([code, path]) => {
            const isHighlighted = top5Codes.has(code);
            return (
              <path
                key={code}
                d={path}
                fill={getCountryColor(code)}
                stroke={getStrokeColor(code)}
                strokeWidth={isHighlighted ? 1 : 0.5}
                strokeLinejoin="round"
                className={isHighlighted ? 'highlighted-country' : 'base-country'}
              >
                <title>{countryNames[code] || code}</title>
              </path>
            );
          })}
        </g>
      </svg>
    </div>
  );
}

export default WorldMap;
